"use strict";

/**
 * Based on the idea from Editorial
 * @param {*} n
 * @param {*} s
 */
function substrCount(n, s) {
  const S_LENGTH = s.length;
  if (S_LENGTH <= 1) return S_LENGTH;

  let ans = 0,
    i = 0;
  let sameCharCount = [];

  let endToCount = new Map();
  // #1. Find substring which is of same char
  while (i < S_LENGTH) {
    let char = s[i],
      cnt = 1;
    let j = i + 1;
    while (s[j] === s[i]) {
      j++;
      cnt++;
    }
    endToCount.set(j - 1, cnt);

    sameCharCount[i] = cnt;
    ans += ((cnt + 1) * cnt) / 2;
    i = j;
  }

  // #2. iterate string s, from second char to the before last,
  // if chars before it and after it are of same char, then we can add min of them.
  for (let j = 1; j < S_LENGTH - 1; j++) {
    if (s[j - 1] === s[j + 1] && s[j - 1] !== s[j]) {
      ans += Math.min(endToCount.get(j - 1), sameCharCount[j + 1]);
    }
  }

  return ans;
}

main();
function main() {
  let inputs = [
    `5
    asasd`, // expects 7
    `7
    abcbaba`, // expects 10
    `4
    aaaa`, // expects 10
    `93534
    `,
  ];

  for (let i = 0; i < inputs.length; i++) {
    let input = inputs[i];
    let lines = input
        .split("\n")
        .map((l) => l.trim())
        .filter((l) => l !== ""),
      index = 0;
    const n = parseInt(lines[index++], 10),
      s = lines[index++];

    const result = substrCount(n, s);
    console.log(result);
  }
}
